import React, { Component } from 'react';
import { Image } from 'react-native';
import { Container, H1, View, DeckSwiper, Card, CardItem, Thumbnail, Text, Left,Right, Body, Icon, Row } from 'native-base';


const cards = [
  {
    place: 'Oaxaca,Oaxaca',
    stars: '4.5',
    image: require('./img/image1.jpg'),
    text: 'lorem ipsum Lorem, ipsum dolor sit amet consectetur adipisicing elite '
  },

];
export default class SwipCards extends Component {
  render() {
    return (
      <Container>

        <View>
          <DeckSwiper
            dataSource={cards}
            renderItem={item =>
              <Card style={{ elevation: 3, border:'solid',  borderRadius:'10px', padding:'20px', color: '#4D5E73' }}>
                        <H1  style = {{padding:'10px'}}>Header One</H1>

                 <CardItem cardBody >

          <Image
            source={item.image}
            style={{ height: 200, flex: 1, padding:'20px' }}
          />
        </CardItem>
        <CardItem style = {{

width:'auto',
height: 'auto',
backgroundColor: 'gray',
borderBottomLeftRadius:'25px',
borderBottomRightRadius:'25px'
}}>



          <Left styles= {{
            flex:'1',
            flexDirection:'col',
            justifyContent:'flex-start'
          }}>
            <Icon  style= {{color: '#4D5E73'}} active name="navigate" />
            <Text >{item.place}</Text>
            </Left>

            <Text style={{flexDirection:'row',
            margin:'15',
            alignContent:"center"}} >
              {item.text}
            </Text>

       <Right>
            <Icon  style= {{color: '#25EAA8', flexDirection:'row'}} active name="star" />
            <Text>
              {item.stars}
            </Text>
            </Right>

        </CardItem>



      </Card>

            }
          />
        </View>

      </Container>
    );
  }
}
